import React,{ useState} from "react";
import NavBar from "../../components/navBar";
import HomeBar from "../../components/homeBar";
import "./styles.css"
import Dialog, {
  DialogActions,
  DialogContent,
  DialogContentText,
  DialogTitle
} from "@material-ui/core/Dialog";


export default function Restaurant() {
 const [openIngredient, setOpenIngredient] = useState(false)
 const [openDish, setOpenDish] = useState(false)
 const [openTable, setOpenTable] = useState(false)
 const [ type, setType]= useState("")
 function handleClickOpen() {
  if(type ==="ingredient"){
    setOpenIngredient(true);
  }if (type === "dish") {
    setOpenDish(true);
  } else {
    setOpenTable(true);
  }
};

function handleClose(){
  if(type ==="ingredient"){
    setOpenIngredient(true);
  }if (type === "dish") {
    setOpenDish(true);
  } else {
    setOpenTable(true);
  }
};

 return (
    <>
      <HomeBar />
      <div id="containerRestaurant">
      <NavBar />
      <div>
        <nav className="options">
          <ul>
            <li>
              <span>Classificações</span>
              <ul>
                <li><button onClick={() => handleClickOpen}>Pratos</button></li>
                <li><button onClick={() => handleClickOpen}>Ingredientes</button></li>
                <li><button onClick={() => handleClickOpen}>Mesas</button></li>
              </ul>
            </li>
          </ul>
        </nav>
      </div>
      </div>

    </>
  );
}
